import React, { useState } from "react";
import {Link} from "react-router-dom";

const CreatePost = () => {
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [image, setImage] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [success, setSuccess] = useState(false);

    const handleImageChange = (e) => {
        const file = e.target.files[0];
        if (file) {
            setImage(file);
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError(null);
        setSuccess(false);

        const formData = new FormData();
        formData.append("secretKey", "martte");
        formData.append("title", title);
        formData.append("description", description);
        if (image) {
            formData.append("image", image);
        }

        try {
            const response = await fetch("http://167.99.138.67:1111/createpost", {
                method: "POST",
                body: formData,
            });

            if (response.ok) {
                const data = await response.json();
                setSuccess(true);
                alert("Post created successfully!");
            } else {
                const errorMessage = await response.text();
                setError(errorMessage);
            }
        } catch (err) {
            setError("Something went wrong. Please try again.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <div>
            <div className="toolbar-container">
                <Link to="/gallery" className="text-white">HOME</Link>
                <Link to="/profile" className="text-white">Users</Link>
            </div>
            <div style={styles.container}>
                <div style={styles.card}>
                    <h2>Create Post</h2>
                    <form onSubmit={handleSubmit}>
                        <div className="d-flex col" style={styles.inputGroup}>
                            <label htmlFor="title"></label>
                            <input
                                type="text"
                                id="title"
                                value={title}
                                onChange={(e) => setTitle(e.target.value)}
                                required
                            />
                        </div>
                        <div style={styles.inputGroup}>
                            <label htmlFor="description">Description</label>
                            <textarea
                                id="description"
                                value={description}
                                onChange={(e) => setDescription(e.target.value)}
                                required
                            />
                        </div>
                        <div style={styles.inputGroup}>
                            <label htmlFor="image">Upload Image</label>
                            <input
                                type="file"
                                id="image"
                                accept="image/*"
                                onChange={handleImageChange}
                                required
                            />
                        </div>

                        <div style={styles.error}>
                            {error && <p style={{color: "red"}}>{error}</p>}
                            {success && <p style={{color: "green"}}>Post created successfully!</p>}
                        </div>

                        <button type="submit" disabled={loading} style={styles.button}>
                            {loading ? "Creating Post..." : "Create Post"}
                        </button>
                    </form>
                </div>
            </div>
        </div>
    );
};

const styles = {
    container: {
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "auto",
        textAlign: "center",
    },
    card: {
        background: "#fff",
        padding: "30px",
        borderRadius: "8px",
        boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
        width: "300px",
        textAlign: "center",
    },
    inputGroup: {
        marginBottom: "15px",
        textAlign: "center",
    },
    input: {
        width: "100%",
        padding: "8px",
        borderRadius: "4px",
        border: "1px solid #ccc",
    },
    button: {
        width: "100%",
        padding: "10px",
        backgroundColor: "#007bff",
        color: "#fff",
        border: "none",
        borderRadius: "4px",
        cursor: "pointer",
    },
    error: {
        marginTop: "10px",
        fontSize: "14px",
    },
};

export default CreatePost;
